import React from 'react';
import AnimatedCursor from 'react-animated-cursor';

const CustomCursor = () => { 
	return (
		<AnimatedCursor 
			innerSize={20}
			outerSize={8}
			color='150, 150, 150'
			innerScale={0.1}
			outerScale={5}
			zIndex={1}
			outerStyle={{
				border: '3px solid red'
			  }}
			  innerStyle={{
				backgroundColor: 'blue'
			  }}
		/>
	)
}

export default CustomCursor;
